import React from 'react'
import Stock from '../components/Stock'

const PortfolioStock = props => {

  const renderStocks = () => {
    debugger
    Object.keys(props.stocks).map(stockId => {
      return <Stock stockId={stockId} stockData={props.stockData}/>
    })
  }
  return( 
    <div>
      {renderStocks()}
    </div>
  )
}

export default PortfolioStock
